import React, { useState } from "react";
import {
  Center,
  VStack,
  Flex,
  Box,
  Grid,
  Stack,
} from "@chakra-ui/react";
import { ColourModeSwitcher } from "../ColourModeSwitcher/colourModeSwitcher.js";
import IntroText from "../IntroText/introText.js";
import InitialFocus from "../Modal/modal.js";
import Comment from "../Comment/comment.js";
import GridBlurredBackdrop from "../Testimonials/testimonials";

export default function App() {
  return (
    <Center textAlign="center" fontSize="xl">
      <Grid minH="100vh" p={3}>
        <ColourModeSwitcher justifySelf="flex-end" />
        <VStack spacing={8}>
          <IntroText />
          <Stack>
            <InitialFocus/>
          </Stack>
        </VStack>
      </Grid>
          <Box p="24px"  my="22px" borderRadius="12px">
      <Flex justify="space-between" w="100%">
        <Flex direction="column" maxWidth="70%"></Flex>
        {/* <GridBlurredBackdrop/> */}
      </Flex>
      </Box>
    </Center>

    
  );
}
